import React from "react";
import classes from './Navbar.module.css';

const Navbar = () => {
    return (
        <nav className='nav'>
        <div className="item">
          <a>Profile</a></div>
        <div className="item">
          <a>Messages</a></div>
        <div className="item">
          <a>News</a></div>
        <div className="item">
          <a>Music</a></div>
      </nav>
    )  
};

export default Navbar;
